import { Row, Col } from "react-bootstrap";

export default function Footer() {
  return (
    <footer className="bg-dark text-light d-flex align-items-center w-100 flex-column" style={{minHeight: ""}}>
      <Row>
        <Col md={3}>
          <h5>Title</h5>
        </Col>
        <Col md={3}>
          <h5>Title</h5>
        </Col>
        <Col md={3}>
          <h5>Title</h5>
        </Col>
      </Row>
    </footer>
  );
}
